import React,{Component} from 'react';
import Table from 'react-bootstrap/Table'
import './App.css';

class App extends Component {
   data = [
   ["0.122584", "0.785882", "0.954039", "0.353008"],
   ["1", "2", "0.954039", "0.353008"],
 ];
   hello ='';
  componentDidMount() {
    fetch('http://localhost:4000/properties')
    .then(res => res.json())
    .then((data) => {
      this.data = data;
      this.hello="gellloooona";
      console.log(this.data);
    })
    .catch(console.log)
  }
  render() {
    return (
        {hello}
    );
  }
}

export default App;
